import styled from "styled-components";
import { FiEye } from "react-icons/fi";

const MainBase = styled.div`
  padding: 2em;
  color: snow;
`;

const Title = styled.h1`
  display: flex;
  align-items: center;
`;

const Main = ({ data }) => (
  <MainBase>
    <Title>
      <FiEye style={{ marginRight: "10px" }} />
      Lil Brother
      {/* <Spinner inline /> */}
      {Object.keys(data).length}
    </Title>

    {JSON.stringify(data)}
  </MainBase>
);

export default Main;
